import React, { useState } from 'react';

const Home = () => {
  const [selectedImage, setSelectedImage] = useState(null);

  const homeImages = [
    '/uploads/HOME PAGE/building trust.jpg',
    '/uploads/HOME PAGE/drainage_.jpg',
    '/uploads/HOME PAGE/for hire...jpg',
    '/uploads/HOME PAGE/Layout.jpg',
    '/uploads/HOME PAGE/PREMIUM MATERIAL SUPPLIER.avif',
    '/uploads/HOME PAGE/road construction.jpg',
    '/uploads/HOME PAGE/ROAD WORK.jpg',
    '/uploads/HOME PAGE/Vehicles.jpg'
  ];

  return (
    <div className="container">
      {/* Video Cover Section */}
      <section className="video-cover-section" style={{ marginBottom: '3rem' }}>
        <div className="video-container" style={{ position: 'relative', width: '100%', height: '400px', overflow: 'hidden', borderRadius: '10px' }}>
          <video 
            autoPlay 
            muted 
            loop 
            style={{ width: '100%', height: '100%', objectFit: 'cover' }}
            poster="/uploads/HOME PAGE/road construction.jpg"
          >
            <source src="/uploads/construction-video.mp4" type="video/mp4" />
            {/* Fallback image if video doesn't load */}
            <img 
              src="/uploads/HOME PAGE/road construction.jpg" 
              alt="Construction Work" 
              style={{ width: '100%', height: '100%', objectFit: 'cover' }}
            />
          </video>
          <div style={{
            position: 'absolute',
            top: 0,
            left: 0,
            width: '100%',
            height: '100%',
            backgroundColor: 'rgba(0,0,0,0.4)',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            color: 'white',
            textAlign: 'center'
          }}>
            <div>
              <h1 style={{ fontSize: '3rem', marginBottom: '1rem' }}>Welcome to {process.env.REACT_APP_COMPANY_NAME || 'Sathguru Babaji Traders'}</h1>
              <p style={{ fontSize: '1.5rem' }}>Your Trusted Construction Partner</p>
            </div>
          </div>
        </div>
      </section>

      <section className="page-section">
        <div className="section-content">
          <p>Your trusted choice for complete construction support. Whether you're building a home, a road, or a commercial spaceâ€”we provide all the essentials under one roof.</p>
          
          <div style={{ marginTop: '2rem' }}>
            <h3>Why Choose {process.env.REACT_APP_COMPANY_NAME || 'Sathguru Babaji Traders'}?</h3>
            <ul style={{ marginTop: '1rem', paddingLeft: '2rem' }}>
              <li style={{ marginBottom: '0.5rem' }}>Complete A to Z Construction Services</li>
              <li style={{ marginBottom: '0.5rem' }}>Well-Maintained Equipment</li>
              <li style={{ marginBottom: '0.5rem' }}>Skilled Labor & Timely Execution</li>
              <li style={{ marginBottom: '0.5rem' }}>Affordable Pricing</li>
              <li style={{ marginBottom: '0.5rem' }}>Transparent & Trusted Service</li>
            </ul>
          </div>

          {/* Image Gallery */}
          <div style={{ marginTop: '3rem' }}>
            <h3>Our Work Gallery</h3>
            <div style={{
              display: 'grid',
              gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))',
              gap: '1rem',
              marginTop: '1rem'
            }}>
              {homeImages.map((image, index) => (
                <div 
                  key={index} 
                  style={{
                    cursor: 'pointer',
                    borderRadius: '8px',
                    overflow: 'hidden',
                    boxShadow: '0 2px 8px rgba(0,0,0,0.1)'
                  }}
                  onClick={() => setSelectedImage(image)}
                >
                  <img 
                    src={image} 
                    alt={`Construction work ${index + 1}`}
                    style={{
                      width: '100%',
                      height: '150px',
                      objectFit: 'cover',
                      transition: 'transform 0.3s ease'
                    }}
                    onMouseEnter={(e) => e.target.style.transform = 'scale(1.05)'}
                    onMouseLeave={(e) => e.target.style.transform = 'scale(1)'}
                  />
                </div>
              ))}
            </div>
          </div>

          <div style={{ marginTop: '2rem', padding: '1.5rem', backgroundColor: '#f8f9fa', borderRadius: '8px' }}>
            <h3>Your One-Stop Solution for All Construction Needs</h3>
            <p>Road & Building Construction | Layout Development | Vehicle Rentals | Wholesale Cement & TMT Dealer</p>
          </div>
        </div>
      </section>

      {/* Image Modal */}
      {selectedImage && (
        <div style={{
          position: 'fixed',
          top: 0,
          left: 0,
          width: '100%',
          height: '100%',
          backgroundColor: 'rgba(0,0,0,0.8)',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          zIndex: 1000
        }} onClick={() => setSelectedImage(null)}>
          <img 
            src={selectedImage} 
            alt="Enlarged view"
            style={{
              maxWidth: '90%',
              maxHeight: '90%',
              objectFit: 'contain'
            }}
          />
        </div>
      )}
    </div>
  );
};

export default Home;
